import React, { Component } from 'react';
import {Link} from 'react-router-dom';

class MyAccountMenu extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <ul>
                <li><a href="">My Account</a></li>
            </ul>
        )
    }
}
export default MyAccountMenu;
